export default function Blogs (){
    return(
        <div className="blogs-conyainer">
            <aeticle>
                {blogs.map((item)=>(
                    <div>
                        <h2>{item.title}</h2>
                        <p>{item.content.substring}</p>
                    </div>
                ))}
            </aeticle>
        </div>
    )
}
